import { Box } from "@chakra-ui/react";
import { Card } from "../components/Card";
import { Header } from "../components/Header";

const Home = () => {
    return (

        <Box minHeight='100vh' backgroundColor='#8d9c98'>
            <Header />
            <Card />
        </Box>

    )
}

export default Home;
